import UIKit

class Solution {
    func strStr(_ haystack: String, _ needle: String) -> Int {
        if (haystack.count == 0  && needle.count == 0) || needle.count == 0 { return 0}
        if !haystack.contains(needle) { return -1 }
        
        guard let firstChar = needle.first,
              let lastChar = needle.last,
              let firstIndexFirstChar = Array(haystack).firstIndex(of: firstChar),
              let lastIndexFirstChar = Array(haystack).lastIndex(of: firstChar),
              let firstIndexLastChar = Array(haystack).firstIndex(of: lastChar),
              let lastIndexLastChar = Array(haystack).lastIndex(of: lastChar) else { return 0 }
        
        print("first: \(firstIndexFirstChar)   \(lastIndexFirstChar)")
        print("last: \(firstIndexLastChar)   \(lastIndexLastChar)")
        print("hey \(firstIndexLastChar - needle.count)")
        print("is it true --> \(needle == String(Array(haystack)[(lastIndexLastChar - needle.count)..<lastIndexLastChar]))")
        if needle == String(Array(haystack)[firstIndexFirstChar..<(needle.count + firstIndexFirstChar)]) {
            return firstIndexFirstChar
        } else if (needle.count + lastIndexFirstChar) < haystack.count  &&
                    needle == String(Array(haystack)[lastIndexFirstChar..<(needle.count + lastIndexFirstChar)]) {
            return lastIndexFirstChar
        } else
        if needle == String(Array(haystack)[(firstIndexLastChar - needle.count )..<firstIndexLastChar]) {
            return firstIndexLastChar - needle.count

        } else if needle == String(Array(haystack)[(lastIndexLastChar - needle.count)..<lastIndexLastChar]) {
            
            return lastIndexLastChar - needle.count
        } else {
            var i = 0
            while i + needle.count < haystack.count {
                if needle == String(Array(haystack)[i..<(needle.count + i)]) { return i }
                i += 1
            }
        }
        
        
        
//        for index in 0..<haystack.count {
//            if String(Array(haystack)[index..<(index + needle.count)]) == needle { return index}
//            print("u \(index)")
////            if index <= needle.count {
////                if haystack.substring(to: String.Index(utf16Offset: index, in: haystack)) == needle { return index}
////            }
//        }
        
//        for (index, _) in Array(haystack).enumerated() {
//            let slice = ArraySlice(haystack)[index..<(needle.count + index)]
//            print("slice \(index)")
//            if needle == String(slice) {
//                //(lastChar == Array(haystack)[index + needle.count-1])
//                return index
//            }
//        }
        return -1
    }
}

